import React from 'react';

import Crd from '../Components/Card';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

import engineering from '../assets/images/engineering.png'



class Experience extends React.Component{
    constructor(props){
        super (props);
    }

    render(){
        return(
            <div>
                <h5 className="font-weight-bolder">Recent Experience</h5>
                <Container fluid = {true} className = "justify-content-around">
                    <Row className = "justify-content-around experience">

                        <Col xl={4} lg = {6} md = {6} sm = {9} >
                            <Crd title="Undergraduate Student Researcher" company="Sonoran Visualization Lab @ Arizona State University" time="[August 2019 - Current]" text="Working on a research project to see the feasability of using NLP automatically recommending datasets  based on a text document" image={engineering} />
                        </Col>

                        <Col xl={4} lg={6} md={6} sm={9} >
                            <Crd title="Undergraduate Student Researcher" company="Arizona State University" time="[August 2019 - Current]" text="blah blah blah" />
                        </Col>

                        <Col xl={4} lg={6} md={6} sm={9} >
                            <Crd title="Undergraduate Student Researcher" company="Arizona State University" time="[August 2019 - Current]" text="blah blah blah" />
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}



export default Experience;
